"terms_and_conditions_paragraph" : "Marriott Bonvoy™ Loyalty Program Membership and its benefits are offered at the discretion of Marriott International, Inc. Marriott and its Partner Programs have the right, without limitation, to change, limit, modify or cancel Program Rules, regulations, Awards, and Award levels at any time, with or without notice, even though such changes may affect the value of Points or Miles already accumulated, the ability to use accumulated Points or Miles, or the ability to obtain certain Awards. Marriott and its Partner Programs may, among other things: 

• increase or decrease the number of Points or Miles received for a stay or required for an Award; 
• withdraw, limit, modify, or cancel any Award or category; 
• add blackout dates, limit rooms available for Award Redemption at any Participating Property, change or restrict Participating Properties, or otherwise restrict the continued availability of Awards; 
• change program benefits, travel partners, locations served by Marriott or its Partner Programs, conditions of participation, rules for earning, redeeming, retaining, or forfeiting Points or Miles, or rules governing the use of Awards; 
• change or cancel its Partner Program awards. The accumulation of Points or Miles does not entitle Members to any vested rights with respect or Points, Miles, Awards, or program benefits. In accumulating Points or Miles, members may not rely upon the continued availability of any Award or Award level and category."

